  const link = "https://www.jiocinema.com/";
  return (
    <div className="App">

      <Navbar/>      
      <div className = "content">
        <h1>MATCHES</h1>
        <a href={link}>Watch Now</a>
        {/* <href>KKRvsRCB</href> */}
